import { CategoriesItem } from '..CategoriesItem/CategoriesItem';

export const CatalogListHomePage = () => {
    const { data } = useGetAllCategoriesQuery();
  return <div>
         <ul>
          {data.map(
            (el, ind) => ind < 4 && <CategoriesItem key={el.id} {...el} />
          )}
        </ul>
  </div>;
};
